import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';
import "src/tools/bootstrap4/css/bootstrap.css";
import "src/tools/bootstrap4/js/bootstrap.js";
import "src/tools/bootstrap4/js/jquery.min.js";
import "src/tools/font-awesome/js/all.min.js";
import "src/tools/font-awesome/css/all.min.css";


ReactDOM.render(<App />, document.getElementById('root'));


serviceWorker.unregister();
